import logo from './logo.svg';
import './App.css';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const activities = ['Homework', 'Dishes', 'Groceries', 'Project']

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul>{ activities}</ul>
      </header>
    </div>
  );
}

export default App;
